import React, {useState} from 'react'
import { Link } from 'react-router-dom'

function Navbar() {
    // const [click, setClick] = useState(false);

    // const handleCLick = () => setClick(!click);
    // const closeMobileMenu = () => setClick(false);
  return (
   <>
    <nav className="navbar">
        <div className="navbar-container">
           <li><a href='/'>Home</a></li>
           <li><a href='/#about-section'>About Us</a></li>
           <li><a href='/secrets-to-selling-your-storage-facility'>How We Help You</a></li>
           <li><a href='/team'>Our Team</a></li>
           <li><a href='/#contact'>Contact Us</a></li>
        </div>
    </nav>
    <div className='navbar-2'>
      <h1>###</h1>
    </div>
    <div className='menu'>
      <li className='menu-item'><a href=''>Home</a></li>
      <li className='menu-item'><a href=''>About Us</a></li>
      <li className='menu-item'><a href=''>How We Help You</a></li>
      <li className='menu-item'><a href=''>Our Team</a></li>
      <li className='menu-item'><a href=''>Contact Us</a></li>
    </div>
   </>
  )
}

export default Navbar
